import React from 'react';
import {Switch, Route} from 'react-router-dom'
import {useSelector} from 'react-redux'
import Home from './homepage/Home'

function Pages() {
    return (
        <Switch>
            <Route path="/" exact component={Home} />
        </Switch>
    );
}

export default Pages;
